// src/app/decisionmaking/decisionmaking.component.ts
import { CommonModule }  from '@angular/common';
import { FormsModule }   from '@angular/forms';
import { Component }     from '@angular/core';

import {
  ArgumentRequest,
  Decision,
  SummaryResponse,
  ArgumentService
} from '../../Services/argument.service';

@Component({
  selector: 'app-decisionmaking',
  standalone: true,
  imports: [CommonModule, FormsModule],
  template: `
    <h2>Single Argument</h2>
    <form (ngSubmit)="submitOne()">
      <label>
        Speaker:
        <input [(ngModel)]="oneReq.speaker" name="speaker" required>
      </label>
      <label>
        Text:
        <input [(ngModel)]="oneReq.text" name="text" required>
      </label>
      <button type="submit">Evaluate</button>
    </form>

    <div *ngIf="oneDecision">
      <strong>Will it work?</strong> {{ oneDecision.willWork }}<br>
      <span *ngIf="oneDecision.reason">
        <em>Reason:</em> {{ oneDecision.reason }}
      </span>
    </div>

    <hr>

    <h2>Batch &amp; Summary</h2>
    <textarea [(ngModel)]="batchInput" rows="5"
              placeholder='[{"speaker":"Alice","text":"…"}]'></textarea>
    <button (click)="submitBatch()">Eval Batch</button>
    <button (click)="getSummary()">Summary</button>

    <h3 *ngIf="batchDecisions?.length">Batch Results</h3>
    <ul>
      <li *ngFor="let d of batchDecisions">
        <strong>{{ d.speaker }}</strong>
        — Will it work? {{ d.willWork }}
        <em *ngIf="d.reason">(Reason: {{ d.reason }})</em>
      </li>
    </ul>

    <div *ngIf="summaryResp">
      <h3>Summary</h3>
      <p>Total arguments: {{ summaryResp.totalArguments }}</p>
      <p>{{ summaryResp.summary }}</p>
    </div>
  `
})
export class DecisionmakingComponent {
  oneReq: ArgumentRequest = { speaker: '', text: '' };
  oneDecision?: Decision;

  batchInput = '[{"speaker":"Alice","text":"…"}]';
  batchDecisions?: Decision[];
  summaryResp?: SummaryResponse;

  constructor(private svc: ArgumentService) {}

  submitOne() {
    this.svc.evalOne(this.oneReq)
      .subscribe(dec => this.oneDecision = dec);
  }

  submitBatch() {
    let reqs: ArgumentRequest[];
    try {
      reqs = JSON.parse(this.batchInput);
    } catch {
      return alert('Invalid JSON');
    }
    this.svc.evalBatch(reqs)
      .subscribe(list => {
        this.batchDecisions = list;
        this.summaryResp = undefined;
      });
  }

  getSummary() {
    let reqs: ArgumentRequest[];
    try {
      reqs = JSON.parse(this.batchInput);
    } catch {
      return alert('Invalid JSON');
    }
    this.svc.summaryBatch(reqs)
      .subscribe(sum => this.summaryResp = sum);
  }
}
